import React, { Fragment } from 'react';

const AppMap = (props) => {
    const {title, desc} = props.todoMap;
    return (
        <Fragment>
            <h3>Todo Test Todo App</h3>
       <div>
                   
                    <h2>{title}</h2>
                     <p>{desc}</p>
                    </div>
        
        </Fragment>
    );
};
export default AppMap;
